import React, { useState } from 'react';
import '../css/facultyDashboard.css';

const FacultyDashboard = () => {
  const [selectedDay, setSelectedDay] = useState('');
  const [selectedTime, setSelectedTime] = useState('');
  const [selectedBlocks, setSelectedBlocks] = useState([]);
  const [searchText, setSearchText] = useState('');
  const [filteredRooms, setFilteredRooms] = useState([]);

  const days = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday'];
  const times = ['9 AM - 10 AM', '10 AM - 11 AM', '11 AM - 12 PM', '1 PM - 2 PM', '2 PM - 3 PM', '3 PM - 4 PM'];

  const rooms = [
    { number: 'A101', block: 'Block A' },
    { number: 'A102', block: 'Block A' },
    { number: 'A103', block: 'Block A' },
    { number: 'B201', block: 'Block B' },
    { number: 'B202', block: 'Block B' },
    { number: 'C301', block: 'Block C' },
    { number: 'C302', block: 'Block C' },
    { number: 'D401', block: 'Block D' },
    { number: 'E501', block: 'Block E' },
  ];

  const handleBlockChange = (block) => {
    setSelectedBlocks(prev =>
      prev.includes(block) ? prev.filter(b => b !== block) : [...prev, block]
    );
  };

  const handleSearch = () => {
    const results = rooms.filter(room => {
      const blockMatch = selectedBlocks.length === 0 || selectedBlocks.includes(room.block);
      const dayTimeSelected = selectedDay !== '' && selectedTime !== '';
      return blockMatch && dayTimeSelected;
    });
    setFilteredRooms(results);
  };

  const handleReset = () => {
    setSelectedDay('');
    setSelectedTime('');
    setSelectedBlocks([]);
    setSearchText('');
    setFilteredRooms([]);
  };

  const handleSearchTextChange = (e) => {
    setSearchText(e.target.value);
  };

  const groupedRooms = filteredRooms
    .filter(room => room.number.toLowerCase().includes(searchText.toLowerCase()))
    .reduce((groups, room) => {
      if (!groups[room.block]) groups[room.block] = [];
      groups[room.block].push(room.number);
      return groups;
    }, {});

  return (
    <div className="faculty-dashboard">
      <div className="dashboard-container">
        <h1>Faculty Dashboard</h1>
        <h2>Select a day and time to view available classrooms</h2>

        <div className="selection-container">
          <label>
            Day:
            <select value={selectedDay} onChange={e => setSelectedDay(e.target.value)}>
              <option value="">Select Day</option>
              {days.map(day => <option key={day} value={day}>{day}</option>)}
            </select>
          </label>
          <label>
            Time:
            <select value={selectedTime} onChange={e => setSelectedTime(e.target.value)}>
              <option value="">Select Time</option>
              {times.map(time => <option key={time} value={time}>{time}</option>)}
            </select>
          </label>
        </div>

        <div className="block-filter">
          {['Block A', 'Block B', 'Block C', 'Block D', 'Block E'].map(block => (
            <label key={block} className="block-checkbox">
              <input
                type="checkbox"
                checked={selectedBlocks.includes(block)}
                onChange={() => handleBlockChange(block)}
              />
              {block}
            </label>
          ))}
        </div>

        <div className="button-group">
          <button className="search-button" onClick={handleSearch}>Search</button>
          <button className="reset-button" onClick={handleReset}>Reset</button>
        </div>

        {filteredRooms.length > 0 && (
          <div className="search-bar-container">
            <input
              type="text"
              className="room-search-input"
              placeholder="Search room number..."
              value={searchText}
              onChange={handleSearchTextChange}
            />
          </div>
        )}

        <div className="room-container">
          {Object.keys(groupedRooms).length === 0 && filteredRooms.length > 0 ? (
            <p>No matching rooms found.</p>
          ) : Object.keys(groupedRooms).length > 0 ? (
            Object.entries(groupedRooms).map(([block, rooms]) => (
              <div key={block} className="block-group">
                <h4>{block}</h4>
                <div className="room-grid">
                  {rooms.map(room => (
                    <button key={room} className="room-box">{room}</button>
                  ))}
                </div>
              </div>
            ))
          ) : (
            <p>Select filters and search to view available classrooms.</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default FacultyDashboard;
